import React from 'react'

const SearchMovie = () => {
    return (
        <div className='flex justify-center pt-[10%]'>
            <form>
                <input type="text" placeholder="Search Movies..." />
                <button>Search</button>
            </form>
        </div>
    )
}

export default SearchMovie
